from collections import Counter
'''给你一个字符串 S、一个字符串 T，请在字符串 S 里面找出：包含 T 所有字母的最小子串。

示例：

输入: S = "ADOBECODEBANC", T = "ABC"
输出: "BANC"
说明：

如果 S 中不存这样的子串，则返回空字符串 ""。
如果 S 中存在这样的子串，我们保证它是唯一的答案。
'''
class Solution:
    def minWindow_chushi(self, s: str, t: str) -> str:
        # 理论实践复杂度是一样的，但是因为实现的原因会比官方方法慢很多
        loc={}
        minLength=len(s)+1
        minIndex=-1
        counter=Counter(t)
        cur=0
        for i,c in enumerate(s):
            if c in t:
                if c not in loc:
                    loc[c]=[i]
                    cur+=1
                else:
                    if counter[c]==len(loc[c]):
                        loc[c].pop(0)
                        loc[c].append(i)
                    else:
                        loc[c].append(i)
                        cur+=1
                if cur==len(t):
                    begin=len(s)-1
                    end=i+1
                    for k,v in loc.items():
                        begin=min(begin,min(v))
                    if end-begin<minLength:
                        minIndex=begin
                        minLength=end-begin
        if minIndex!=-1:
            return s[minIndex:minIndex+minLength]
        else:
            return ''

    def minWindow_youhua(self, s: str, t: str) -> str:
        # 滑动窗口法，官方的解释存在第二种优化，就是只把出现在t中的字符和其索引存储起来，这样就不需要对是否是t中的字符做两次判断
        count = Counter(t)
        filter=[(i,c) for i,c in enumerate(s) if c in count]
        left = 0
        minIndex = -1
        minLength = len(s) + 1
        last = len(count.keys())
        for i, c in filter:
            count[c] -= 1
            if count[c] == 0:
                last -= 1
                while last == 0:
                    if (i + 1 - left) < minLength:
                        minIndex = left
                        minLength = i + 1 - left
                    if s[left] in count:
                        count[s[left]] += 1
                        if count[s[left]] > 0:
                            last += 1
                    left += 1
        return s[minIndex:minIndex + minLength] if minIndex != -1 else ''

    def minWindow(self, s: str, t: str) -> str:
        count=Counter(t)
        left=0
        minIndex=-1
        minLength=len(s)+1
        last=len(count.keys())
        for i,c in enumerate(s):
            if c in count:
                count[c]-=1
                if count[c]==0:
                    last-=1
                    while last==0:
                        if (i + 1 - left) < minLength:
                            minIndex = left
                            minLength = i + 1 - left
                        if s[left] in count:
                            count[s[left]]+=1
                            if count[s[left]]>0 :
                                last+=1
                        left+=1
        return s[minIndex:minIndex+minLength] if minIndex!=-1 else ''




